import { Switch } from '@material-ui/core';
import { BrowserRouter as Router ,Routes, Redirect, Route} from 'react-router-dom';
import './App.css';
import Cart from './Pages/Cart';
import Hom from './Pages/Hom';
import Login from './Pages/Login';
import Product from './Pages/Product';
import ProductList from './Pages/ProductList';
import Register from './Pages/Register';
import Announcement from './shared/components/Announcement';
import Footer from './shared/components/Footer';
import Navbar from './shared/components/Navbar';

function App() {
  const user =true;
  return (
<Router>
    <Announcement/>
      <Navbar/>

    <Route path="/" exact>  <Hom /></Route>
    <Route path="/product" exact>  <Product /></Route>
    <Route path="/cart" exact>  < Cart/></Route>
    <Route path="/products/:category" exact>  <ProductList /></Route>
    <Route path="/product/:id" exact>  <Product /></Route>
    <Route path="/login" exact> {user ? <Redirect to="/" /> :<Login/>} </Route>
    <Route path="/register" exact>  {user ? <Redirect to="/" /> :<Register/>}</Route>
    <Redirect to = "/"/>

    <Footer/></Router>



  );
}

export default App;
